English, 255 pages and awesome : JC H, by Shiwasu No Okina

It's entirely translated into English, 255 awesome pictures full with happy very hardcore sex :D

Teens and young adults having tons of sex, duos, threesomes, groupsex, candid or perverted, with an extremely good drawing style...

This is one of the best works of the artist Shiwasu No Okina.
